pragma solidity ^0.4.17;
contract Guess4 {
    //global variables
    address owner;
    address creator;
    //bytes32[4] bytesArray; // size must be fixed
    uint[5] resultArray;
    //uint8 correctCount = 0;
    uint8[4] guesses;

  //  uint _guess1;

    //modifiers
    modifier restricted() {
        require(msg.sender == owner);
        _;
    }

    // initialize
    function Guess4() public {
        owner = msg.sender;

    }
    function kill() public {
        if(msg.sender == owner) selfdestruct(owner);
    }
    function  time_call(uint8 _adder) public{
        uint adder = _adder;
        uint timeNow  = now/1000 + adder;
        //resultArray[0] = timeNow;
        resultArray[0] = timeNow % 2;
        resultArray[1] = timeNow % 3;
        resultArray[2] = timeNow % 5;
        resultArray[3] = timeNow % 7;
        resultArray[4] = timeNow;
        //resultArray[4] = timeNow % 10;
    }

    function getArray() constant public returns ( uint[5])
    {
        return resultArray;
    }

    function getValue(uint8 x) constant public returns (uint)
    {
        return resultArray[x];
    }

    function createGuesses(uint8 guess0, uint8 guess1, uint8 guess2, uint8 guess3) public restricted returns (uint8) {
        uint8 adder = guess0 + guess1 + guess2 + guess3;
        guesses[0] = guess0;
        guesses[1] = guess1;
        guesses[2] = guess2;
        guesses[3] = guess3;
        time_call(adder);
        testCalls();

    }

    function testCalls()  public view returns (string) {
        uint8 correctCount = 0;
        string memory result_answer;
        for(uint8 i = 0; i < 4; i++){
            if(resultArray[i] == guesses[i]) {
                correctCount++;
            }
            if (correctCount == guesses.length){
              result_answer = "you got the CTF 0x0001234";
            } else {
              result_answer = "Try again";
            }
        }
         return result_answer;
    }

}
